import React, { Component } from 'react';
import ImageCard from './imagecard';
import ImageFilter from './imagefilter'
import ImageItems from "./imageitems";

class main extends Component {
    render() {
        return (
            <div id='page'>
                <ImageCard/>
                <ImageFilter/>
                <ImageItems/>
            </div>
        );
    }
}

export default main;
